import React from "react";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import Footer from "./Components/common/Footer";
import Header from "./Components/common/Header";
import ContactPage from "./pages/ContactPage";
import HomePage from "./pages/HomePage";
import ProductPage from "./pages/ProductPage";
import AboutPage from "./pages/AboutPage";
import FistikliBaklavalarPage from "./pages/FistikliBaklavalarPage";
import CevizliBaklavaPage from "./pages/CevizliBaklavaPage";
import HazirPaketlerPage from "./pages/HazirPaketlerPage";
/* import i18n from "./i18n"; */

function App({ t }) {
  /*   const changeLanguage = (lng) => {
    i18n.changeLanguage(lng);
  }; */
  return (
    <BrowserRouter>
      {/* <button onClick={() => changeLanguage("de")}>de</button>
      <button onClick={() => changeLanguage("en")}>en</button>
      <h1>{t("Welcome to React")}</h1> */}
      <Header />
      <Routes>
        <Route path="/hazirpaketler" element={<HazirPaketlerPage />} />
        <Route path="/cevizlilibaklavalar" element={<CevizliBaklavaPage />} />
        <Route
          path="/fistiklibaklavalar"
          element={<FistikliBaklavalarPage />}
        />
        <Route path="/iletisim" element={<ContactPage />} />
        <Route path="/urunlerimiz" element={<ProductPage />} />
        <Route path="/hakkimizda" element={<AboutPage />} />
        <Route path="/" element={<HomePage />} />
      </Routes>
      <Footer />
    </BrowserRouter>
  );
}

export default App;
